Explicación: Este soneto es claramente del poeta español Francisco de Quevedo, uno de los más grandes escritores del Siglo de Oro español, que vivió entre finales del siglo XVI y principios del siglo XVII (1580-1645). El poema está dedicado a Raimundo, y muestra el estilo barroco y conceptista característico de Quevedo, con un juego de palabras y conceptos típico de su obra poética.
